import React from 'react'
import Proptypes from "prop-types"

import Thing from './thing'

const ThingList = ({ data }) => {
  return (
    <>
      <div className="container">
        {data && data.map(thing => (
          <Thing
            src={thing.src}
            date={thing.date}
            name={thing.name}
          ></Thing>
        ))}
        <Thing
          src="https://images.unsplash.com/photo-1515405295579-ba7b45403062?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          date="9/12/20"
          name="Painting"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1447933601403-0c6688de566e?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          date="9/17/20"
          name="Roasted Coffee"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1563520239648-a24e51d4b570?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          name="3D Printing Thasn Tljhf Jfeo aLHFsd"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1521572163474-6864f9cf17ab?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          name="T-Shirt Design"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1522139137660-4248e04955b8?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          name="Logo Design"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1581291518633-83b4ebd1d83e?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          name="User Experience"
        ></Thing>
        <Thing
          src="https://images.unsplash.com/photo-1525547719571-a2d4ac8945e2?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
          name="Application"
        ></Thing>
        <Thing></Thing>
        <Thing></Thing>
        <Thing></Thing>
        <Thing></Thing>
        <Thing name="Applicatio"></Thing>
      </div>
      <style jsx>
        {`
          .container {
            width: 100%;
            display: grid;
            padding: 20px;
            grid-gap: 20px;
            overflow: auto;
            max-width: 800px;
            padding-left: 20px;
            align-content: start;
            justify-items: center;
            padding-right: 20px;
            justify-content: space-between;
            grid-template-columns: 1fr 1fr 1fr;
          }
          @media (max-width: 767px) {
            .container {
              grid-template-columns: 1fr 1fr;
            }
          }
          @media (max-width: 479px) {
            .container {
              grid-template-columns: 1fr;
            }
          }
        `}
      </style>
    </>
  )
}

ThingList.proptypes = {
  data: Proptypes.arrayOf({
    src: Proptypes.string,
    name: Proptypes.string,
    data: Proptypes.string
  })
}

export default ThingList
